const uid = () => "f_" + Math.random().toString(36).slice(2, 10);

function escapeHtml(str) {
  if (str == null) return "";
  return String(str)
    .replace(/&/g, "&amp;")
    .replace(/</g, "&lt;")
    .replace(/>/g, "&gt;")
    .replace(/"/g, "&quot;")
    .replace(/'/g, "&#039;");
}

// YYYY-MM-DD -> dd/MM/yyyy
function formatarDataBR(isoDate) {
  if (!isoDate) return "-";
  const [ano, mes, dia] = String(isoDate).split("-");
  if (!ano || !mes || !dia) return isoDate;
  return `${dia}/${mes}/${ano}`;
}

function formatarDataFlexBR(valor) {
  if (!valor) return "-";
  const s = String(valor).trim();
  const semHora = s.split("T")[0].replace(/\//g, "-");
  const partes = semHora.split("-");
  if (partes.length === 3) {
    const [a, b, c] = partes;
    if (a.length === 4) return `${c.padStart(2, "0")}/${b.padStart(2, "0")}/${a}`;
    if (c.length === 4) return `${a.padStart(2, "0")}/${b.padStart(2, "0")}/${c}`;
  }
  const d = new Date(s);
  if (!isNaN(d)) {
    const dd = String(d.getDate()).padStart(2, "0");
    const mm = String(d.getMonth() + 1).padStart(2, "0");
    const yyyy = d.getFullYear();
    return `${dd}/${mm}/${yyyy}`;
  }
  return s;
}

function formatarDataHoraFlexBR(valor) {
  if (!valor) return "-";
  const s = String(valor).trim();

  let m = s.match(/^(\d{4})-(\d{2})-(\d{2})(?:[T\\s](\\d{2}):(\\d{2})(?::(\\d{2}))?)?$/);
  if (m) {
    const [, Y, Mo, D, h = "00", mi = "00"] = m;
    return `${D}/${Mo}/${Y} ${h}:${mi}`;
  }

  m = s.match(/^(\\d{2})[\\/-](\\d{2})[\\/-](\\d{4})(?:\\s+(\\d{2}):(\\d{2})(?::(\\d{2}))?)?$/);
  if (m) {
    const [, D, Mo, Y, h = "00", mi = "00"] = m;
    return `${D}/${Mo}/${Y} ${h}:${mi}`;
  }

  const d = new Date(s);
  if (!isNaN(d)) {
    const dd = String(d.getDate()).padStart(2, "0");
    const mm = String(d.getMonth() + 1).padStart(2, "0");
    const yyyy = d.getFullYear();
    const hh = String(d.getHours()).padStart(2, "0");
    const min = String(d.getMinutes()).padStart(2, "0");
    return `${dd}/${mm}/${yyyy} ${hh}:${min}`;
  }
  return formatarDataFlexBR(s);
}

function getSelectValueAndLabel(selectEl) {
  if (!selectEl) return { value: "", label: "" };
  const idx = selectEl.selectedIndex;
  const opt = idx >= 0 ? selectEl.options[idx] : null;
  return { value: selectEl.value || "", label: opt ? opt.text : "" };
}

// ----------------------
// FOTOS — cartões
// ----------------------
function criarCartaoFoto({ src, nome = "", descricao = "", id = uid() }) {
  const card = document.createElement("article");
  card.className = "foto-item";
  card.dataset.uid = id;

  const fig = document.createElement("figure");
  fig.className = "foto-item__preview";
  const img = document.createElement("img");
  img.src = src;
  img.alt = nome ? `Foto: ${nome}` : "Foto do relatório";
  img.loading = "lazy";
  fig.appendChild(img);

  const box = document.createElement("div");
  box.className = "foto-item__form";

  const nomeWrap = document.createElement("div");
  nomeWrap.className = "field";
  const nomeLbl = document.createElement("label");
  nomeLbl.setAttribute("for", `fotoNome-${id}`);
  nomeLbl.textContent = "Nome da foto";
  const nomeInp = document.createElement("input");
  nomeInp.id = `fotoNome-${id}`;
  nomeInp.name = "foto_nome[]";
  nomeInp.type = "text";
  nomeInp.required = true;
  nomeInp.maxLength = 120;
  nomeInp.placeholder = "Ex.: Ensaio PHI — Lote L2025-09";
  nomeInp.value = nome || "";
  nomeWrap.appendChild(nomeLbl);
  nomeWrap.appendChild(nomeInp);

  const descWrap = document.createElement("div");
  descWrap.className = "field";
  const descLbl = document.createElement("label");
  descLbl.setAttribute("for", `fotoDesc-${id}`);
  descLbl.textContent = "Descrição";
  const descTxt = document.createElement("textarea");
  descTxt.id = `fotoDesc-${id}`;
  descTxt.name = "foto_descricao[]";
  descTxt.rows = 2;
  descTxt.placeholder = "Contexto, equipamento, local, operador…";
  descTxt.value = descricao || "";
  descWrap.appendChild(descLbl);
  descWrap.appendChild(descTxt);

  const uidHidden = document.createElement("input");
  uidHidden.type = "hidden";
  uidHidden.name = "foto_uid[]";
  uidHidden.value = id;

  const actions = document.createElement("div");
  actions.className = "foto-item__actions";
  const btnRem = document.createElement("button");
  btnRem.type = "button";
  btnRem.className = "remover remover--foto";
  btnRem.setAttribute("aria-label", "Remover esta foto");
  btnRem.textContent = "❌";
  btnRem.addEventListener("click", () => {
    card.remove();
    if (ariaLive) ariaLive.textContent = "🗑️ Foto removida.";
  });
  actions.appendChild(btnRem);

  box.appendChild(nomeWrap);
  box.appendChild(descWrap);
  box.appendChild(uidHidden);
  box.appendChild(actions);

  card.appendChild(fig);
  card.appendChild(box);
  imagePreview.appendChild(card);
}

function addFiles(files) {
  const maxMB = 5;

  Array.from(files || []).forEach((file) => {
    // só aceita imagens
    if (!/^image\//i.test(file.type)) return;

    // limita tamanho (5 MB)
    if (file.size > maxMB * 1024 * 1024) return;

    const fr = new FileReader();
    fr.onload = (e) => {
      const dataUrl = e.target.result;

      // nome sem extensão
      const baseName = (file.name || "").replace(/\.[^.]+$/, "");

      criarCartaoFoto({
        src: dataUrl,
        nome: baseName || "Foto",
      });

      if (ariaLive) {
        ariaLive.textContent = "📸 Foto adicionada.";
      }
    };

    fr.readAsDataURL(file);
  });
}


// ----------------------
// GERAR RELATÓRIO (obj)
// ----------------------
function gerarRelatorio() {
  const dados = {};

  dados.identificacao = {
    ordemProducao: form.ordemProducao?.value || "",
    quantidadeaverificar: form.quantidadeaverificar?.value || "",
    quandoexecutarinspecao: form.quandoexecutarinspecao?.value || "",
    horasInspecao: form.horasInspecao?.value || "",
    dataRelatorio: form.dataRelatorio?.value || "",
  };

  dados.produtos = [];
  form.querySelectorAll("#tabelaProdutos tbody tr").forEach((tr) => {
    const produto = {
      descricao: tr.querySelector("input[name='descricao[]']")?.value || "",
      lote: tr.querySelector("input[name='lote[]']")?.value || "",
      data: tr.querySelector("input[name='data[]']")?.value || "",
      quantidade: tr.querySelector("input[name='quantidade[]']")?.value || "",
    };
    if (produto.descricao) dados.produtos.push(produto);
  });

  dados.ensaios = [];
  form.querySelectorAll("#tabelaEnsaios tbody tr").forEach((tr) => {
    const ensaioSel = tr.querySelector("select[name='ensaio[]']");
    const amostrasSel = tr.querySelector("select[name='amostras[]']");
    const metodoSel = tr.querySelector("select[name='metodo[]']");
    const resultadoSel = tr.querySelector("select[name='resultado[]']");

    const tipo = getSelectValueAndLabel(ensaioSel);
    const amostras = getSelectValueAndLabel(amostrasSel);
    const metodo = getSelectValueAndLabel(metodoSel);
    const resultado = getSelectValueAndLabel(resultadoSel);

    if (tipo.value) {
      dados.ensaios.push({
        tipo: tipo.value,
        tipoLabel: tipo.label,
        amostras: amostras.value,
        amostrasLabel: amostras.label || amostras.value,
        metodo: metodo.value,
        metodoLabel: metodo.label,
        resultado: resultado.value,
        resultadoLabel: resultado.label,
      });
    }
  });

  const norma = getSelectValueAndLabel(selNorma);
  dados.observacoes = txtObservacoes?.value?.trim() || "";
  dados.norma = norma.value || "";
  dados.normaLabel = norma.label || norma.value;

  dados.fotos = [];
  const cards = imagePreview.querySelectorAll(".foto-item");
  cards.forEach((card, idx) => {
    const img = card.querySelector("img");
    const nome = card.querySelector("input[name='foto_nome[]']")?.value?.trim() || `Foto ${idx + 1}`;
    const descricao = card.querySelector("textarea[name='foto_descricao[]']")?.value?.trim() || "";
    const id = card.dataset.uid || uid();
    if (img && img.src) dados.fotos.push({ uid: id, nome, descricao, src: img.src });
  });

  return dados;
}

// ----------------------
// LISTA LATERAL
// ----------------------
function atualizarListaRelatorios() {
  if (!listaRelatorios) return;
  listaRelatorios.innerHTML = "";
  const chaves = Object.keys(localStorage).filter((k) => k.startsWith("relatorio_"));
  chaves.sort();
  chaves.forEach((chave) => {
    let dados;
    try {
      dados = JSON.parse(localStorage.getItem(chave));
    } catch {
      return;
    }
    if (!dados) return;

    const li = document.createElement("li");
    li.style.display = "flex";
    li.style.justifyContent = "space-between";
    li.style.alignItems = "center";
    li.style.marginBottom = "4px";

    const span = document.createElement("span");
    span.textContent = `#${dados.identificacao?.ordemProducao || "?"} (${dados.identificacao?.dataRelatorio || "sem data"})`;
    span.style.cursor = "pointer";
    span.addEventListener("click", () => carregarRelatorio(dados));

    const btnExcluir = document.createElement("button");
    btnExcluir.textContent = "❌";
    btnExcluir.style.border = "none";
    btnExcluir.style.background = "transparent";
    btnExcluir.style.cursor = "pointer";
    btnExcluir.title = "Excluir relatório";
    btnExcluir.addEventListener("click", (e) => {
      e.stopPropagation();
      if (confirm("Tem certeza que deseja excluir este relatório?")) {
        localStorage.removeItem(chave);
        atualizarListaRelatorios();
        if (ariaLive) ariaLive.textContent = "🗑️ Relatório excluído.";
      }
    });

    li.appendChild(span);
    li.appendChild(btnExcluir);
    listaRelatorios.appendChild(li);
  });
}

// ----------------------
// SALVAR / CARREGAR
// ----------------------
function salvarRelatorio() {
  const dados = gerarRelatorio();
  if (!dados.identificacao.ordemProducao) {
    alert("Preencha ao menos o Nº da Ficha de Produção.");
    return;
  }
  const chave = `relatorio_${dados.identificacao.ordemProducao}`;
  localStorage.setItem(chave, JSON.stringify(dados));
  atualizarListaRelatorios();
  if (ariaLive) ariaLive.textContent = "✅ Relatório salvo com sucesso.";
}

function carregarRelatorio(dados) {
  if (!form) return;

  form.ordemProducao.value = dados.identificacao?.ordemProducao || "";
  form.quantidadeaverificar.value = dados.identificacao?.quantidadeaverificar || "";
  form.quandoexecutarinspecao.value = dados.identificacao?.quandoexecutarinspecao || "";
  form.horasInspecao.value = dados.identificacao?.horasInspecao || "";
  form.dataRelatorio.value = dados.identificacao?.dataRelatorio || "";

  if (txtObservacoes) txtObservacoes.value = dados.observacoes || "";
  if (selNorma) selNorma.value = dados.norma || "";

  const tbodyProdutos = document.querySelector("#tabelaProdutos tbody");
  const tbodyEnsaios = document.querySelector("#tabelaEnsaios tbody");
  if (tbodyProdutos) tbodyProdutos.innerHTML = "";
  if (tbodyEnsaios) tbodyEnsaios.innerHTML = "";

  (dados.produtos || []).forEach((p) => adicionarProduto(p));
  (dados.ensaios || []).forEach((e) => adicionarEnsaio(e));

  if (imagePreview) {
    imagePreview.innerHTML = "";
    (dados.fotos || []).forEach((f, i) => {
      if (typeof f === "string") {
        criarCartaoFoto({ src: f, nome: `Foto ${i + 1}` });
      } else if (f && (f.src || f.dataUrl)) {
        criarCartaoFoto({
          src: f.src || f.dataUrl,
          nome: f.nome || `Foto ${i + 1}`,
          descricao: f.descricao || "",
          id: f.uid || uid(),
        });
      }
    });
  }

  if (ariaLive) ariaLive.textContent = "📂 Relatório carregado.";
}

