function exportarPDF() {
  const dados = gerarRelatorio();

  if (!window.jspdf || !window.jspdf.jsPDF) {
    alert("Biblioteca jsPDF não carregada. Confira o script jspdf.umd.min.js.");
    return;
  }

  const { jsPDF } = window.jspdf;
  const doc = new jsPDF({ unit: "pt", format: "a4" });

  if (typeof doc.autoTable !== "function") {
    alert("Plugin jsPDF-AutoTable não carregado. Confira o script jspdf.plugin.autotable.min.js.");
    return;
  }

  const agora = new Date();
  const dataHora =
    agora.toLocaleDateString("pt-BR") +
    " " +
    agora.toLocaleTimeString("pt-BR");

  const LEFT = 40;
  const TOP = 30;
  const TITLE = "RQ-504-01 — REGISTRO DE INSPEÇÃO";
  const TITLE_SIZE = 18;

  // Conversão px -> pt para o logo
  const PX_TO_PT = 72 / 96;
  const MAX_W_PX = 120;
  const MAX_H_PX = 50;
  const MAX_W_PT = MAX_W_PX * PX_TO_PT;
  const MAX_H_PT = MAX_H_PX * PX_TO_PT;

  // Logo
  const logo = new Image();
  logo.crossOrigin = "anonymous";
  logo.src = "shiva.png";

  const renderPDF = () => {
    doc.setDrawColor(225, 38, 45);
    doc.setLineWidth(1.2);

    const nW = Number(logo.naturalWidth) || 0;
    const nH = Number(logo.naturalHeight) || 0;
    const ratio = nW > 0 && nH > 0 ? nH / nW : 0.5;

    let wPt = MAX_W_PT;
    let hPt = wPt * ratio;
    if (hPt > MAX_H_PT) {
      hPt = MAX_H_PT;
      wPt = hPt / ratio;
    }

    try {
      doc.addImage(logo, "PNG", LEFT, TOP, wPt, hPt);
    } catch (e) {
      console.error("Erro ao inserir logo:", e);
    }

    doc.setFont("helvetica", "bold");
    doc.setFontSize(TITLE_SIZE);
    doc.setTextColor(14, 53, 84);

    const logoCenterY = TOP + hPt / 2;
    const baselineAdjust = TITLE_SIZE * 0.35;
    const titleY = logoCenterY + baselineAdjust;
    const titleX = LEFT + wPt + 16;
    doc.text(TITLE, titleX, titleY);

    const textH = (doc.getTextDimensions?.(TITLE)?.h) || TITLE_SIZE * 1.15;
    const headerH = Math.max(hPt, textH);
    const headerBottom = TOP + headerH + 12;

    // Linha abaixo do cabeçalho
    doc.line(LEFT, headerBottom, 550, headerBottom);

    // ===============================
    // 1. IDENTIFICAÇÃO
    // ===============================
    doc.setFont("helvetica", "bold");
    doc.setFontSize(12);
    doc.setTextColor(14, 53, 84);
    doc.text("1. IDENTIFICAÇÃO", LEFT, headerBottom + 20);

    doc.autoTable({
      startY: headerBottom + 30,
      theme: "grid",
      headStyles: {
        fillColor: [14, 53, 84],
        textColor: 255,
        fontStyle: "bold",
        halign: "center",
      },
      alternateRowStyles: { fillColor: [240, 245, 250] },
      bodyStyles: { fontSize: 10 },
      head: [["Nº Ficha", "Qtd Verificar", "Quando Executar", "Horas de inspeção", "Data"]],
      body: [
        [
          dados.identificacao?.ordemProducao || "-",
          dados.identificacao?.quantidadeaverificar || "-",
          dados.identificacao?.quandoexecutarinspecao || "-",
          dados.identificacao?.horasInspecao || "-",
          formatarDataBR(dados.identificacao?.dataRelatorio),
        ],
      ],
    });

    // ===============================
    // 2. PRODUTOS
    // ===============================
    doc.setTextColor(14, 53, 84);
    doc.text("2. PRODUTOS INSPECIONADOS", LEFT, doc.lastAutoTable.finalY + 30);

    doc.autoTable({
      startY: doc.lastAutoTable.finalY + 40,
      theme: "grid",
      headStyles: {
        fillColor: [14, 53, 84],
        textColor: 255,
        fontStyle: "bold",
        halign: "center",
      },
      alternateRowStyles: { fillColor: [245, 248, 252] },
      bodyStyles: { fontSize: 10 },
      head: [["Produto", "Lote", "Data", "Quantidade"]],
      body: (dados.produtos || []).map((p) => [
        p.descricao || "-",
        p.lote || "-",
        formatarDataBR(p.data),
        p.quantidade || "-",
      ]),
    });

    // ===============================
    // 3. ENSAIOS
    // ===============================
    doc.setTextColor(14, 53, 84);
    doc.text("3. ENSAIOS REALIZADOS", LEFT, doc.lastAutoTable.finalY + 30);

    doc.autoTable({
      startY: doc.lastAutoTable.finalY + 40,
      theme: "grid",
      headStyles: {
        fillColor: [14, 53, 84],
        textColor: 255,
        fontStyle: "bold",
        halign: "center",
      },
      alternateRowStyles: { fillColor: [245, 248, 252] },
      bodyStyles: { fontSize: 10 },
      head: [["Ensaio", "Amostras", "Método", "Resultado"]],
      body: (dados.ensaios || []).map((e) => [
        e.tipoLabel || e.tipo || "-",
        e.amostrasLabel || e.amostras || "-",
        e.metodoLabel || e.metodo || "-",
        e.resultadoLabel || e.resultado || "-",
      ]),
    });

    // ===============================
    // 4. OBSERVAÇÕES + NORMA
    // ===============================
    doc.setTextColor(14, 53, 84);
    doc.text("4. OBSERVAÇÕES E NORMA", LEFT, doc.lastAutoTable.finalY + 30);

    doc.autoTable({
      startY: doc.lastAutoTable.finalY + 40,
      theme: "grid",
      headStyles: {
        fillColor: [14, 53, 84],
        textColor: 255,
        fontStyle: "bold",
        halign: "center",
      },
      alternateRowStyles: { fillColor: [245, 248, 252] },
      bodyStyles: { fontSize: 10, valign: "top" },
      columnStyles: {
        0: { cellWidth: 380 },
        1: { cellWidth: 130 },
      },
      head: [["Observações", "Norma"]],
      body: [[dados.observacoes || "—", dados.normaLabel || "—"]],
    });

    // ===============================
    // 5. FOTOS
    // ===============================
    let y = doc.lastAutoTable.finalY + 30;
    doc.setFont("helvetica", "bold");
    doc.setFontSize(12);
    doc.setTextColor(14, 53, 84);
    doc.text("5. REGISTRO FOTOGRÁFICO", LEFT, y);
    y += 16;

    const pageW = doc.internal.pageSize.getWidth();
    const pageH = doc.internal.pageSize.getHeight();
    const colGapFotos = 24;
    const colsFotos = 2;
    const colWidthFotos = ((pageW - LEFT - 40) - colGapFotos * (colsFotos - 1)) / colsFotos;

    let colIndex = 0;
    let x = LEFT;

    (dados.fotos || []).forEach((f, idx) => {
      const src = typeof f === "string" ? f : f.src;
      const nome = typeof f === "object" && f?.nome ? f.nome : `Foto ${idx + 1}`;
      const descricao = typeof f === "object" && f?.descricao ? f.descricao : "";

      const imgW = Math.min(180, colWidthFotos);
      const imgH = 120;
      const needH = imgH + 60;

      if (y + needH > pageH - 150) {
        doc.addPage();
        y = 80;
        x = LEFT;
        colIndex = 0;
      }

      try {
        const isPng = /^data:image\/png/i.test(src);
        const fmt = isPng ? "PNG" : "JPEG";
        doc.addImage(src, fmt, x, y, imgW, imgH);
      } catch (e) {
        console.error("Erro ao inserir foto:", e);
      }

      doc.setFont("helvetica", "bold");
      doc.setFontSize(10);
      doc.setTextColor(0);
      const nomeWrap = doc.splitTextToSize(nome, colWidthFotos);
      doc.text(nomeWrap, x, y + imgH + 14);

      doc.setFont("helvetica", "normal");
      doc.setFontSize(9);
      const descWrap = doc.splitTextToSize(descricao, colWidthFotos);
      const nomeHeight = (Array.isArray(nomeWrap) ? nomeWrap.length : 1) * 12;
      doc.text(descWrap, x, y + imgH + 14 + nomeHeight + 4);

      colIndex++;
      if (colIndex >= colsFotos) {
        colIndex = 0;
        x = LEFT;
        const descHeight = (Array.isArray(descWrap) ? descWrap.length : 1) * 11;
        y += imgH + 14 + nomeHeight + 4 + descHeight + 16;
      } else {
        x += colWidthFotos + colGapFotos;
      }
    });

    // ===============================
    // 6. ASSINATURAS (2 colunas com imagem)
    // ===============================
    let sigY;
    if (y > pageH - 200) {
      doc.addPage();
      sigY = 120;
    } else {
      sigY = Math.max(y + 40, pageH - 180);
    }

    const totalWidth = pageW - LEFT * 2;
    const gapAss = 30;
    const colWidthAss = (totalWidth - gapAss * 2) /2;

    const col1X1 = LEFT;
    const col1X2 = col1X1 + colWidthAss;

    const col2X1 = col1X2 + gapAss;
    const col2X2 = col2X1 + colWidthAss;    

    const sigImgH = 40;
    const imgY = sigY - sigImgH - 4; 
  
   
   
    try {
      doc.addImage(ASSINATURA_MATEUS, "PNG", col1X1, imgY, col1X2 - col1X1, sigImgH);
    } catch (e) {
      console.error("Erro ao inserir assinatura Mateus:", e);
    }   
    
      try {
      doc.addImage(ASSINATURA_CLEVERSON, "PNG", col2X1, imgY, col2X2 - col2X1, sigImgH);
    } catch (e) {
      console.error("Erro ao inserir assinatura Cleverson:", e);
    }

    doc.setFont("helvetica", "bold");
    doc.setFontSize(12);
    doc.setTextColor(0);

    doc.line(col1X1, sigY, col1X2, sigY);
    doc.text("Responsável ", (col1X1 + col1X2) / 2, sigY + 15, { align: "center" });   

    doc.line(col2X1, sigY, col2X2, sigY);
    doc.text("Supervisor", (col2X1 + col2X2) / 2, sigY + 15, { align: "center" });

    // Rodapé
    doc.setFontSize(8);
    doc.setTextColor(120);
    doc.text(
      `Relatório gerado automaticamente pelo sistema RQ-504-01 | Emitido em: ${dataHora}`,
      LEFT,
      pageH - 30
    );

    doc.save(`Relatorio_${dados.identificacao?.ordemProducao || "sem_numero"}.pdf`);
  };

  logo.onload = renderPDF;
  logo.onerror = renderPDF;
  if (logo.complete) setTimeout(renderPDF, 0);
}



