// UPLOAD DE FOTOS
// ----------------------
function handleFiles(files) {
  addFiles(files);
}
fileInput?.addEventListener("change", () => handleFiles(fileInput.files));

if (uploadArea) {
  const prevent = (ev) => {
    ev.preventDefault();
    ev.stopPropagation();
  };
  ["dragenter", "dragover", "dragleave", "drop"].forEach((evt) =>
    uploadArea.addEventListener(evt, prevent)
  );
  uploadArea.addEventListener("dragover", () => uploadArea.classList.add("dragover"));
  uploadArea.addEventListener("dragleave", () => uploadArea.classList.remove("dragover"));
  uploadArea.addEventListener("drop", (e) => {
    uploadArea.classList.remove("dragover");
    handleFiles(e.dataTransfer.files);
  });
}

// Validação leve (nome da foto)
form?.addEventListener("submit", (ev) => {
  const faltando = imagePreview.querySelector(
    ".foto-item input[name='foto_nome[]']:invalid"
  );
  if (faltando) {
    ev.preventDefault();
    faltando.focus();
    faltando.reportValidity?.();
  }
});

// ----------------------
// TEMA
// ----------------------
function aplicarTema(tema) {
  if (!tema) return;
  document.documentElement.setAttribute("data-theme", tema);
  localStorage.setItem("tema", tema);
  const radio = dlgTemas?.querySelector(`input[name='tema'][value="${tema}"]`);
  if (radio) radio.checked = true;
}
btnTemas?.addEventListener("click", () => {
  dlgTemas?.showModal();
  const primeiroRadio = dlgTemas?.querySelector("input[name='tema']");
  if (primeiroRadio) primeiroRadio.focus();
});
dlgTemas?.addEventListener("submit", (e) => {
  e.preventDefault();
  const temaSelecionado = dlgTemas?.querySelector("input[name='tema']:checked");
  if (temaSelecionado) aplicarTema(temaSelecionado.value);
  dlgTemas?.close();
});
dlgTemas?.addEventListener("click", (e) => {
  const rect = dlgTemas.getBoundingClientRect();
  if (
    e.clientX < rect.left ||
    e.clientX > rect.right ||
    e.clientY < rect.top ||
    e.clientY > rect.bottom
  ) {
    dlgTemas.close();
  }
});
document.addEventListener("DOMContentLoaded", () => {
  const temaSalvo = localStorage.getItem("tema");
  if (temaSalvo) aplicarTema(temaSalvo);
});

